  data() {
    return {
      certificado: {
        id: null,
        dominio: null,
        url_ssls: null,
      }
    }
  },

  mounted() {
    if (this.$route?.params?.id) {
      this.getCertificado(this.$route.params.id);
    }
  },

  methods: {
    async persistir() {
      try {
        let certificado = { 
          dominio: this.certificado.dominio,
          url_ssls: this.certificado.url_ssls,
        };
        if (!this.certificado.id) {
          let response = await axios.post('http://localhost:8000/certificados/', certificado);

          response = response.data.dominio
          this.$router.push('/ssl')

        } else {
            certificado.id = this.certificado.id
            await axios.put(`http://localhost:8000/certificados/${certificado.id}/`, certificado);
            return this.$router.push('/ssl');
        }
      } catch (error) {
        console.log("Deu erro")
        console.log(error) 
        // this.$toast.error(`Ocorreu um erro no cadastro, contate o administrador`)
      }
    },
    async getCertificado (id) {
      console.log(id)
      try {
        let certificado = await axios.get(`http://localhost:8000/certificados/${id}/`);
        this.certificado = certificado.data
      } catch (error) {
        console.log(error)
      }
    }
  }
